[[package]]
name = "click"
version = "8.1.3"
requires_python = ">=3.7"
summary = "Composable command line interface toolkit"
dependencies = [
    "colorama; platform_system == \"Windows\"",
]

[[package]]
name = "click-aliases"
version = "1.0.1"
summary = "Enable aliases for Click"
dependencies = [
    "click",
]

[[package]]
name = "colorama"
version = "0.4.6"
requires_python = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*,!=3.5.*,!=3.6.*,>=2.7"
summary = "Cross-platform colored terminal text."

[[package]]
name = "deprecation"
version = "2.1.0"
summary = "A library to handle automated deprecations"
dependencies = [
    "packaging",
]

[[package]]
name = "img2pdf"
version = "0.4.4"
summary = "Convert images to PDF via direct JPEG inclusion."
dependencies = [
    "Pillow",
    "pikepdf",
]

[[package]]
name = "lxml"
version = "4.9.2"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, != 3.4.*"
summary = "Powerful and Pythonic XML processing library combining libxml2/libxslt with the ElementTree API."

[[package]]
name = "markdown-it-py"
version = "2.2.0"
requires_python = ">=3.7"
summary = "Python port of markdown-it. Markdown parsing, done right!"
dependencies = [
    "mdurl~=0.1",
]

[[package]]
name = "mdurl"
version = "0.1.2"
requires_python = ">=3.7"
summary = "Markdown URL utilities"

[[package]]
name = "packaging"
version = "23.0"
requires_python = ">=3.7"
summary = "Core utilities for Python packages"

[[package]]
name = "pdf2image"
version = "1.16.3"
summary = "A wrapper around the pdftoppm and pdftocairo command line tools to convert PDF to a PIL Image list."
dependencies = [
    "pillow",
]

[[package]]
name = "pikepdf"
version = "7.1.1"
requires_python = ">=3.8"
summary = "Read and write PDFs with Python, powered by qpdf"
dependencies = [
    "Pillow>=9.0",
    "deprecation",
    "lxml>=4.8",
    "packaging",
]

[[package]]
name = "pillow"
version = "9.4.0"
requires_python = ">=3.7"
summary = "Python Imaging Library (Fork)"

[[package]]
name = "pygments"
version = "2.14.0"
requires_python = ">=3.6"
summary = "Pygments is a syntax highlighting package written in Python."

[[package]]
name = "pypdf2"
version = "3.0.1"
requires_python = ">=3.6"
summary = "A pure-python PDF library capable of splitting, merging, cropping, and transforming PDF files"

[[package]]
name = "rich"
version = "13.3.2"
requires_python = ">=3.7.0"
summary = "Render rich text, tables, progress bars, syntax highlighting, markdown and more to the terminal"
dependencies = [
    "markdown-it-py<3.0.0,>=2.2.0",
    "pygments<3.0.0,>=2.13.0",
]

